import { Component } from 'react';

// import components from src/components
import MyHeader from './components/MyHeader';
import MyForm from './components/MyForm';

// Component defined as ES6+ class
class App extends Component {
	render() {
		return (
			<div className="App">
				<MyHeader />
				<MyForm />
			</div>
		);
	}
}

export default App;
